import axios from "axios";
import { useEffect,useState } from "react";


function TT(){

    const [getdata,setData]= useState([]);
	useEffect(()=>{
		axios.get("http://localhost/laravel8/laravel8/public/api/blog")
		.then(res =>{
			setData(res.data.blog.data) 
			console.log(getdata)      
		})
		.catch(function (error) {
			console.log(error)
		})
	},[])
}
export default TT;
